import React from "react";
import { Modal, Form } from "react-bootstrap";
import styeleprof from "./profile.module.css";
function EditProfile({ handleShow, handleClose, id }) {
  return (
    <Modal
      show={handleShow}
      onHide={handleClose}
      centered
      className={styeleprof.editmodal}
    >
      <Form className={styeleprof.formmodal}>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Fullname</Form.Label>
          <Form.Control type="text" placeholder="Enter email" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Email</Form.Label>
          <Form.Control type="email" placeholder="ex: user@mail..." />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Phone Number</Form.Label>
          <Form.Control type="text" placeholder="ex: 081...." />
        </Form.Group>
      </Form>
    </Modal>
  );
}

export default EditProfile;
